"use strict";

function makeFancyString(s) {
    let ans = [];
    for (let i = 0; i < s.length; i++) {
        let c = s.charAt(i);
        if (ans.length > 1 && ans[ans.length - 1] === ans[ans.length - 2] && ans[ans.length - 1] === c) {
            continue;
        }
        ans.push(c);
    }
    return ans.join("");
}
